import React, { Component } from 'react';


export default class Data extends Component {
    constructor(props) {
        super(props);
        const [FullName, Name, DOB, NIC] = this.state(
            {
                FullName: '',
                Name: 'Blaesad',
                DOB: '',
                NIC: ''
            }
        )
    }
}

